import logo from './logo.svg';
import './App.css';
import Image from './Image';

const src = 'https://cdn.pixabay.com/photo/2017/02/20/18/03/cat-2083492_1280.jpg'
function App() {
  return (
    <main>
      <Image src={src} alt = 'Cute cat staring'></Image>
    </main>
  );
}

export default App;
